import React from 'react';
import {connect} from 'react-redux';
import PawfileBlurb from '../home/pawfile-blurb';

import './sidebar.css'

export function Sidebar(props){
  console.log(props);
  return(
      <aside class="sidebar left">
        <PawfileBlurb {...props.pawfile}/>
      <article class="brief female">
        <div class="image-placeholder">Image Placeholder</div>
        <h2>Mushy</h2>
        <p><strong>Species:</strong> Cat</p>
        <p><strong>Breed:</strong> Domestic Mix</p>
        <p><strong>Gender:</strong>Female</p>
        <p><strong>Birthday:</strong> October 21, 2016</p>
        <p><strong>Bio:</strong> Meow. I'm a cute troublemaker. I'll purr then hiss. Give me scritches?</p>
      </article>
      <article class="brief reminders">
        <h2>Reminders</h2>
        <ul class="reminders-list">
          <li class="darker-shade">Trim Mushy's Nails</li>
          <li>Apply Flea Meds</li>
          <li class="darker-shade">Vet Appointment</li>
        </ul>
        <button>Add New</button>
      </article>
    </aside>
    );
}

const mapStateToProps = (state, props) => ({
  pawfile: state.pawfile.pawfiles[props.id],
});

export default connect(mapStateToProps)(Sidebar);
